import Card from "./Components/Card";
import javascript from "./images/javascript.png";
import java from "./images/java.png";
console.log(javascript);

function App() {
    return (
        <>
            <Card images={javascript} title="JavaScript" type="Frontend and Backend"/>
            <Card images={javascript} title="JavaScript" type="Frontend and Backend"/>
            <Card images={javascript} title="JavaScript" type="Frontend and Backend"/>
        </>
    )
};


export default App;
